', '8.99', '16', '18'),
(276, 'Set Orecchini Etnici Tondi Donna Uomo Ragazza Ragazzo a Cerchio - Piccoli Cerchi Rotondi Tribali Fatti a Mano x Lobo – Belli Particolari e Originali a Luna – Monili ad Anello in Legno', '- AMI I VESTITI TRENDY SEMPLICI ED ESOTICI , CARINI E STRANI ? Allora la nostra coppia di orecchini alternativi unisex in stile balinese sono il perfetto accessorio per te ! I pendenti doppi moderni e di tendenza per maschio e femmina
